@test integrate(x^2*(A+B*x+C*x^2)*(a+b*x^2+c*x^4), x) == :(x^5*(1//5*A*b+1//5*C*a)+x^7*(1//7*A*c+1//7*C*b)+1//3*A*a*x^3+1//4*B*a*x^4+1//6*B*b*x^6+1//8*B*c*x^8+1//9*C*c*x^9)
@test integrate(x*(A+B*x+C*x^2)*(a+b*x^2+c*x^4), x) == :(x^4*(1//4*A*b+1//4*C*a)+x^6*(1//6*A*c+1//6*C*b)+(1/2)*A*a*x^2+1//3*B*a*x^3+1//5*B*b*x^5+1//7*B*c*x^7+1//8*C*c*x^8)
@test integrate((A+B*x+C*x^2)*(a+b*x^2+c*x^4), x) == :(x^3*(1//3*A*b+1//3*C*a)+x^5*(1//5*A*c+1//5*C*b)+A*a*x+(1/2)*B*a*x^2+1//4*B*b*x^4+1//6*B*c*x^6+1//7*C*c*x^7)
@test integrate(x^-1*(A+B*x+C*x^2)*(a+b*x^2+c*x^4), x) == :(x^2*((1/2)*A*b+(1/2)*C*a)+x^4*(1//4*A*c+1//4*C*b)+A*a*log(x)+B*a*x+1//3*B*b*x^3+1//5*B*c*x^5+1//6*C*c*x^6)
@test integrate(x^-2*(A+B*x+C*x^2)*(a+b*x^2+c*x^4), x) == :(x*(A*b+C*a)+x^3*(1//3*A*c+1//3*C*b)+B*a*log(x)+(1/2)*B*b*x^2+-1*A*a*x^-1+1//4*B*c*x^4+1//5*C*c*x^5)
@test integrate(x^-3*(A+B*x+C*x^2)*(a+b*x^2+c*x^4), x) == :(x^2*((1/2)*A*c+(1/2)*C*b)+(A*b+C*a)*log(x)+B*b*x+-1*B*a*x^-1+-1//2*A*a*x^-2+1//3*B*c*x^3+1//4*C*c*x^4)
@test integrate(x^-4*(A+B*x+C*x^2)*(a+b*x^2+c*x^4), x) == :(x*(A*c+C*b)+-1*x^-1*(A*b+C*a)+B*b*log(x)+(1/2)*B*c*x^2+-1//2*B*a*x^-2+-1//3*A*a*x^-3+1//3*C*c*x^3)
@test integrate(x^-5*(A+B*x+C*x^2)*(a+b*x^2+c*x^4), x) == :((A*c+C*b)*log(x)+-1//2*x^-2*(A*b+C*a)+B*c*x+(1/2)*C*c*x^2+-1*B*b*x^-1+-1//3*B*a*x^-3+-1//4*A*a*x^-4)
@test integrate(x^-6*(A+B*x+C*x^2)*(a+b*x^2+c*x^4), x) == :(-1*x^-1*(A*c+C*b)+-1//3*x^-3*(A*b+C*a)+B*c*log(x)+C*c*x+-1//2*B*b*x^-2+-1//4*B*a*x^-4+-1//5*A*a*x^-5)
@test integrate(x^-7*(A+B*x+C*x^2)*(a+b*x^2+c*x^4), x) == :(-1//2*x^-2*(A*c+C*b)+-1//4*x^-4*(A*b+C*a)+C*c*log(x)+-1*B*c*x^-1+-1//3*B*b*x^-3+-1//5*B*a*x^-5+-1//6*A*a*x^-6)
@test integrate(x^2*(a+b*x^2+c*x^4)^2*(A+B*x+C*x^2), x) == :(x^7*(1//7*A*(b^2+2*a*c)+2//7*C*a*b)+x^9*(1//9*C*(b^2+2*a*c)+2//9*A*b*c)+1//3*A*a^2*x^3+1//4*B*a^2*x^4+1//5*a*x^5*(C*a+2*A*b)+1//8*B*x^8*(b^2+2*a*c)+1//11*c*x^11*(A*c+2*C*b)+1//12*B*c^2*x^12+1//13*C*c^2*x^13+1//3*B*a*b*x^6+1//5*B*b*c*x^10)
@test integrate(x*(a+b*x^2+c*x^4)^2*(A+B*x+C*x^2), x) == :(x^6*(1//6*A*(b^2+2*a*c)+1//3*C*a*b)+x^8*(1//8*C*(b^2+2*a*c)+1//4*A*b*c)+(1/2)*A*a^2*x^2+1//3*B*a^2*x^3+1//4*a*x^4*(C*a+2*A*b)+1//7*B*x^7*(b^2+2*a*c)+1//10*c*x^10*(A*c+2*C*b)+1//11*B*c^2*x^11+1//12*C*c^2*x^12+2//5*B*a*b*x^5+2//9*B*b*c*x^9)
@test integrate((a+b*x^2+c*x^4)^2*(A+B*x+C*x^2), x) == :(x^5*(1//5*A*(b^2+2*a*c)+2//5*C*a*b)+x^7*(1//7*C*(b^2+2*a*c)+2//7*A*b*c)+A*x*a^2+(1/2)*B*a^2*x^2+1//3*a*x^3*(C*a+2*A*b)+1//6*B*x^6*(b^2+2*a*c)+1//9*c*x^9*(A*c+2*C*b)+1//10*B*c^2*x^10+1//11*C*c^2*x^11+(1/2)*B*a*b*x^4+1//4*B*b*c*x^8)
@test integrate(x^-1*(a+b*x^2+c*x^4)^2*(A+B*x+C*x^2), x) == :(x^4*(1//4*A*(b^2+2*a*c)+(1/2)*C*a*b)+x^6*(1//6*C*(b^2+2*a*c)+1//3*A*b*c)+A*a^2*log(x)+B*x*a^2+(1/2)*a*x^2*(C*a+2*A*b)+1//5*B*x^5*(b^2+2*a*c)+1//8*c*x^8*(A*c+2*C*b)+1//9*B*c^2*x^9+1//10*C*c^2*x^10+2//3*B*a*b*x^3+2//7*B*b*c*x^7)
@test integrate(x^-2*(a+b*x^2+c*x^4)^2*(A+B*x+C*x^2), x) == :(x^3*(1//3*A*(b^2+2*a*c)+2//3*C*a*b)+x^5*(1//5*C*(b^2+2*a*c)+2//5*A*b*c)+B*a^2*log(x)+a*x*(C*a+2*A*b)+-1*A*a^2*x^-1+1//4*B*x^4*(b^2+2*a*c)+1//7*c*x^7*(A*c+2*C*b)+1//8*B*c^2*x^8+1//9*C*c^2*x^9+B*a*b*x^2+1//3*B*b*c*x^6)
@test integrate(x^-3*(a+b*x^2+c*x^4)^2*(A+B*x+C*x^2), x) == :(x^2*((1/2)*A*(b^2+2*a*c)+C*a*b)+x^4*(1//4*C*(b^2+2*a*c)+(1/2)*A*b*c)+a*(C*a+2*A*b)*log(x)+-1*B*a^2*x^-1+-1//2*A*a^2*x^-2+1//3*B*x^3*(b^2+2*a*c)+1//6*c*x^6*(A*c+2*C*b)+1//7*B*c^2*x^7+1//8*C*c^2*x^8+2*B*a*b*x+2//5*B*b*c*x^5)
@test integrate(x^-4*(a+b*x^2+c*x^4)^2*(A+B*x+C*x^2), x) == :(x*(A*(b^2+2*a*c)+2*C*a*b)+x^3*(1//3*C*(b^2+2*a*c)+2//3*A*b*c)+(1/2)*B*x^2*(b^2+2*a*c)+-1*a*x^-1*(C*a+2*A*b)+-1//2*B*a^2*x^-2+-1//3*A*a^2*x^-3+1//5*c*x^5*(A*c+2*C*b)+1//6*B*c^2*x^6+1//7*C*c^2*x^7+(1/2)*B*b*c*x^4+2*B*a*b*log(x))
@test integrate(x^-5*(a+b*x^2+c*x^4)^2*(A+B*x+C*x^2), x) == :(x^2*((1/2)*C*(b^2+2*a*c)+A*b*c)+(A*(b^2+2*a*c)+2*C*a*b)*log(x)+B*x*(b^2+2*a*c)+-1//2*a*x^-2*(C*a+2*A*b)+-1//3*B*a^2*x^-3+-1//4*A*a^2*x^-4+1//4*c*x^4*(A*c+2*C*b)+1//5*B*c^2*x^5+1//6*C*c^2*x^6+-2*B*a*b*x^-1+2//3*B*b*c*x^3)
@test integrate(x^-6*(a+b*x^2+c*x^4)^2*(A+B*x+C*x^2), x) == :(x*(C*(b^2+2*a*c)+2*A*b*c)+-1*x^-1*(A*(b^2+2*a*c)+2*C*a*b)+B*(b^2+2*a*c)*log(x)+-1//3*a*x^-3*(C*a+2*A*b)+-1//4*B*a^2*x^-4+-1//5*A*a^2*x^-5+1//3*c*x^3*(A*c+2*C*b)+1//4*B*c^2*x^4+1//5*C*c^2*x^5+B*b*c*x^2+-1*B*a*b*x^-2)
@test integrate(x^-7*(a+b*x^2+c*x^4)^2*(A+B*x+C*x^2), x) == :((C*(b^2+2*a*c)+2*A*b*c)*log(x)+-1//2*x^-2*(A*(b^2+2*a*c)+2*C*a*b)+(1/2)*c*x^2*(A*c+2*C*b)+-1*B*x^-1*(b^2+2*a*c)+-1//4*a*x^-4*(C*a+2*A*b)+-1//5*B*a^2*x^-5+-1//6*A*a^2*x^-6+1//3*B*c^2*x^3+1//4*C*c^2*x^4+2*B*b*c*x+-2//3*B*a*b*x^-3)
@test integrate(x^4*(a+b*x^2+c*x^4)^-1*(A+B*x+C*x^2), x) == :(x*c^-2*(A*c+-1*C*b)+(1/2)*B*c^-1*x^2+1//3*C*c^-1*x^3+-1//4*B*b*c^-2*log(a+b*x^2+c*x^4)+-1//2*B*c^-2*(b^2+-4*a*c)^-1//2*(b^2+-2*a*c)*arctanh((b^2+-4*a*c)^-1//2*(b+2*c*x^2))+-1//2*2^(1/2)*c^-5//2*(b+(b^2+-4*a*c)^(1/2))^-1//2*((b^2+-4*a*c)^-1//2*(A*c*(b^2+-2*a*c)+-1*C*b*(b^2+-3*a*c))+-1*C*b^2+A*b*c+C*a*c)*arctan(x*2^(1/2)*c^(1/2)*(b+(b^2+-4*a*c)^(1/2))^-1//2)+-1//2*2^(1/2)*c^-5//2*(b+-1*(b^2+-4*a*c)^(1/2))^-1//2*(-1*C*b^2+-1*(b^2+-4*a*c)^-1//2*(A*c*(b^2+-2*a*c)+-1*C*b*(b^2+-3*a*c))+A*b*c+C*a*c)*arctan(x*2^(1/2)*c^(1/2)*(b+-1*(b^2+-4*a*c)^(1/2))^-1//2))
@test integrate(x^3*(a+b*x^2+c*x^4)^-1*(A+B*x+C*x^2), x) == :(B*x*c^-1+(1/2)*C*c^-1*x^2+1//4*c^-2*(A*c+-1*C*b)*log(a+b*x^2+c*x^4)+(1/2)*c^-2*(b^2+-4*a*c)^-1//2*(-1*C*b^2+A*b*c+2*C*a*c)*arctanh((b^2+-4*a*c)^-1//2*(b+2*c*x^2))+-1//2*B*2^(1/2)*c^-3//2*(b+(b^2+-4*a*c)^(1/2))^-1//2*(b+(b^2+-4*a*c)^-1//2*(b^2+-2*a*c))*arctan(x*2^(1/2)*c^(1/2)*(b+(b^2+-4*a*c)^(1/2))^-1//2)+-1//2*B*2^(1/2)*c^-3//2*(b+-1*(b^2+-4*a*c)^(1/2))^-1//2*(b+-1*(b^2+-4*a*c)^-1//2*(b^2+-2*a*c))*arctan(x*2^(1/2)*c^(1/2)*(b+-1*(b^2+-4*a*c)^(1/2))^-1//2))
@test integrate(x^2*(a+b*x^2+c*x^4)^-1*(A+B*x+C*x^2), x) == :(C*x*c^-1+1//4*B*c^-1*log(a+b*x^2+c*x^4)+(1/2)*B*b*c^-1*(b^2+-4*a*c)^-1//2*arctanh((b^2+-4*a*c)^-1//2*(b+2*c*x^2))+(1/2)*2^(1/2)*c^-3//2*(b+(b^2+-4*a*c)^(1/2))^-1//2*(A*c+(b^2+-4*a*c)^-1//2*(-1*C*b^2+A*b*c+2*C*a*c)+-1*C*b)*arctan(x*2^(1/2)*c^(1/2)*(b+(b^2+-4*a*c)^(1/2))^-1//2)+(1/2)*2^(1/2)*c^-3//2*(b+-1*(b^2+-4*a*c)^(1/2))^-1//2*(A*c+-1*C*b+-1*(b^2+-4*a*c)^-1//2*(-1*C*(b^2+-2*a*c)+A*b*c))*arctan(x*2^(1/2)*c^(1/2)*(b+-1*(b^2+-4*a*c)^(1/2))^-1//2))
@test integrate(x*(a+b*x^2+c*x^4)^-1*(A+B*x+C*x^2), x) == :(1//4*C*c^-1*log(a+b*x^2+c*x^4)+-1//2*c^-1*(b^2+-4*a*c)^-1//2*(-1*C*b+2*A*c)*arctanh((b^2+-4*a*c)^-1//2*(b+2*c*x^2))+(1/2)*B*2^(1/2)*c^-1//2*(b+(b^2+-4*a*c)^(1/2))^(1/2)*(b^2+-4*a*c)^-1//2*arctan(x*2^(1/2)*c^(1/2)*(b+(b^2+-4*a*c)^(1/2))^-1//2)+-1//2*B*2^(1/2)*c^-1//2*(b+-1*(b^2+-4*a*c)^(1/2))^(1/2)*(b^2+-4*a*c)^-1//2*arctan(x*2^(1/2)*c^(1/2)*(b+-1*(b^2+-4*a*c)^(1/2))^-1//2))
@test integrate((a+b*x^2+c*x^4)^-1*(A+B*x+C*x^2), x) == :(-1*B*(b^2+-4*a*c)^-1//2*arctanh((b^2+-4*a*c)^-1//2*(b+2*c*x^2))+(1/2)*2^(1/2)*c^-1//2*(b+(b^2+-4*a*c)^(1/2))^-1//2*(C+-1*(b^2+-4*a*c)^-1//2*(-1*C*b+2*A*c))*arctan(x*2^(1/2)*c^(1/2)*(b+(b^2+-4*a*c)^(1/2))^-1//2)+(1/2)*2^(1/2)*c^-1//2*(b+-1*(b^2+-4*a*c)^(1/2))^-1//2*(C+(b^2+-4*a*c)^-1//2*(-1*C*b+2*A*c))*arctan(x*2^(1/2)*c^(1/2)*(b+-1*(b^2+-4*a*c)^(1/2))^-1//2))
@test integrate(x^-1*(a+b*x^2+c*x^4)^-1*(A+B*x+C*x^2), x) == :(A*a^-1*log(x)+-1//4*A*a^-1*log(a+b*x^2+c*x^4)+(1/2)*a^-1*(b^2+-4*a*c)^-1//2*(A*b+-2*C*a)*arctanh((b^2+-4*a*c)^-1//2*(b+2*c*x^2))+B*2^(1/2)*c^(1/2)*(b+-1*(b^2+-4*a*c)^(1/2))^-1//2*(b^2+-4*a*c)^-1//2*arctan(x*2^(1/2)*c^(1/2)*(b+-1*(b^2+-4*a*c)^(1/2))^-1//2)+-1*B*2^(1/2)*c^(1/2)*(b+(b^2+-4*a*c)^(1/2))^-1//2*(b^2+-4*a*c)^-1//2*arctan(x*2^(1/2)*c^(1/2)*(b+(b^2+-4*a*c)^(1/2))^-1//2))
@test integrate(x^-2*(a+b*x^2+c*x^4)^-1*(A+B*x+C*x^2), x) == :(B*a^-1*log(x)+-1*A*a^-1*x^-1+-1//4*B*a^-1*log(a+b*x^2+c*x^4)+(1/2)*B*b*a^-1*(b^2+-4*a*c)^-1//2*arctanh((b^2+-4*a*c)^-1//2*(b+2*c*x^2))+-1//2*2^(1/2)*a^-1*c^(1/2)*(b+(b^2+-4*a*c)^(1/2))^-1//2*(A+-1*(b^2+-4*a*c)^-1//2*(A*b+-2*C*a))*arctan(x*2^(1/2)*c^(1/2)*(b+(b^2+-4*a*c)^(1/2))^-1//2)+-1//2*2^(1/2)*a^-1*c^(1/2)*(b+-1*(b^2+-4*a*c)^(1/2))^-1//2*(A+(b^2+-4*a*c)^-1//2*(A*b+-2*C*a))*arctan(x*2^(1/2)*c^(1/2)*(b+-1*(b^2+-4*a*c)^(1/2))^-1//2))
@test integrate(x^-3*(a+b*x^2+c*x^4)^-1*(A+B*x+C*x^2), x) == :(-1*B*a^-1*x^-1+-1*a^-2*(A*b+-1*C*a)*log(x)+-1//2*A*a^-1*x^-2+1//4*a^-2*(A*b+-1*C*a)*log(a+b*x^2+c*x^4)+-1//2*a^-2*(b^2+-4*a*c)^-1//2*(A*(b^2+-2*a*c)+-1*C*a*b)*arctanh((b^2+-4*a*c)^-1//2*(b+2*c*x^2))+-1//2*B*2^(1/2)*a^-1*c^(1/2)*(b+(b^2+-4*a*c)^(1/2))^-1//2*(1+-1*b*(b^2+-4*a*c)^-1//2)*arctan(x*2^(1/2)*c^(1/2)*(b+(b^2+-4*a*c)^(1/2))^-1//2)+-1//2*B*2^(1/2)*a^-1*c^(1/2)*(b+-1*(b^2+-4*a*c)^(1/2))^-1//2*(1+b*(b^2+-4*a*c)^-1//2)*arctan(x*2^(1/2)*c^(1/2)*(b+-1*(b^2+-4*a*c)^(1/2))^-1//2))
